  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for the Brussels
  District of Mark Twain National Wildlife Refuge summarizes Refuge activities during
  the 2000 fiscal year.  Apple Creek WMA, Portage Island, the Calhoun Division, the
  Gilbert Lake Division, and the Batchtown Division are included.  The report begins
  with an introduction to the Refuge and a summary of the yearu2019s highlights and
  climatic conditions.  Information about monitoring and studies- including surveys
  and censuses- is provided next.  Habitat restoration and management projects are
  also covered; activities include water level management, moist soil management,
  mowing, farming, prescribed burning, and vegetation control.  Fish and wildlife
  management is discussed next with emphasis on bird banding and nest structures.
  \ Coordination activities, such as interagency coordination and private land activities,
  are outlined.  The resource protection section provides information about law enforcement
  and permits.  Information about public education and recreation is given.  Finally,
  Refuge planning and administration are discussed.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
